private static boolean containsUpperCase(final Iterable<String> strings) {
  for(String s : strings) {
    for(int i = 0; i < s.length(); i++) {
      if (Character.isUpperCase(s.charAt(i))) {
        return true;
      }
    }
  }
  return false;
}
